// ***************************************** MAIN PAGE  ******************************************

var loading = false;
var oldscroll = 0;
var limit=20;
var counter=1;
var condition=[];
var finalcondition=[];

$.ajaxSetup({
    headers: {
        'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
    }
});

//  LOAD ADVERTISMENT
function  load_data() {

    $.ajax({
        url:'/Api/moreAdvertisment',
        method:'post',
        data:{counter:counter,limit:limit,conditions:condition},
        success:function (data) {
            if(data!=='')
            {
                if (counter===0)
                {
                    $('#load_data').html(data);
                }
                else
                {
                    $('#load_data').append(data);
                }
                counter++;
                loading=false;
            }
            else
            {
                if(counter===0)
                    $('#load_data').html('<div class="col-12 bold text-center alert alert-warning">متاسفانه نتیجه ای یافت نشد</div>');
                loading=true;
            }

            document.getElementById('loading').classList.remove('d-block');
            document.getElementById('loading').classList.add('d-none');
        }
    });
}

// LAZY LOAD WITH SCROLL MOUSE
function lazyload() {
    $(window).scroll(function () {
        if ($(window).scrollTop() > oldscroll) {
            if (($(window).scrollTop() + $(window).height() >= $(document).height()-600)) {
                if (!loading)
                {
                    loading=true;
                    oldscroll=$(window).scrollTop();
                    load_data();
                    document.getElementById('loading').classList.remove('d-none');
                    document.getElementById('loading').classList.add('d-block');
                }
            }
        }
    });
}

