function resetParametr() {
    counter=0;
    $(window).scrollTop(0);
    oldscroll=0;

    $('#filterBox').html('');
    $('#haveimg').prop('checked',false);
    $('#haveurgent').prop('checked',false);
    $('#who').val('');

    $('#haveimg-mobile').prop('checked',false);
    $('#haveurgent-mobile').prop('checked',false);
    $('#who-mobile').val('');
    $('.mobile-filter').remove();
}

