                    $('#aj_search_content').html(data)
                                           .append('<div class="mt-2">' +
                                               '<input type="submit" value="مـشاهده همه نتایج" class="btn mx-auto text-center text-dark font-yekan font-size-14 text-decoration-none" href="search/'+search+'"/> </div>');
